export default ({ cell, handleClick }) => {
	if (cell) {
		if (cell['receptionInfo']) {
			return (
				<div className={styles.col} onClick={(e) => handleClick(e)}>
					<div className={styles.date}>
						{cell['date']}
					</div>
					<div className={styles.time}>
						{cell['receptionInfo']}
					</div>
				</div>
			);
		} else {
			return (
				<div className={styles.colNotAllowed}>
					<div className={styles.date}>
						{cell['date']}
					</div>
				</div>
			);
		}
	} else {
			return <div className={styles.colEmpty} ></div>
	}
};
